import React from 'react';

function Notify({ notify }) {
    console.log(notify);
    return (
        <div className="fixed top-2 right-2 p-4 h-20  w-40" >
            <div></div>
            <span className="bg-green-400 h-2" ></span>
        </div>
    );
}

export default Notify;
